 // We also multiply the slope by an arbitrary z-factor of 1.25\n    float slope = atan(1.25 * length(deriv) / scaleFactor);\n    float aspect = deriv.x != 0.0 ? atan(deriv.y, -deriv.x) : PI / 2.0 * (deriv.y > 0.0 ? 1.0 : -1.0);\n\n    float intensity = u_light.x;\n    // We add PI to make this property match the global light object, which adds PI/2 to the light's azimuthal\n    // position property to account for 0deg corresponding to north/the top of the viewport in the style spec\n    // and the original shader was written to accept (-illuminationDirection - 90) as the azimuthal.\n    float azimuth = u_light.y + PI;\n\n    // We scale the slope exponentially based on intensity, using a calculation similar to\n    // the exponential interpolation function in the style spec:\n    // so that higher intensity values create more opaque hillshading.\n    float base = 1.875 - intensity * 1.75;\n    float maxValue = 0.5 * PI;\n    float scaledSlope = intensity != 0.5 ? ((pow(base, slope) - 1.0) / (pow(base, maxValue) - 1.0)) * maxValue : slope;\n\n    // The accent color is calculated with the cosine of the slope while the shade color is calculated with the sine\n    // so that the accent color's rate of change eases in while the shade color's eases out.\n    float accent = cos(scaledSlope);\n    // We multiply both the accent and shade color by a clamped intensity value\n    // so that intensities >= 0.5 do not additionally affect the color values\n    // while intensity values < 0.5 make the overall color more transparent.\n    vec4 accent_color = (1.0 - accent) * u_accent * clamp(intensity * 2.0, 0.0, 1.0);\n    float shade = abs(mod((aspect + azimuth) / PI + 0.5, 2.0) - 1.0);\n    vec4 shade_color = mix(u_shadow, u_highlight, shade) * sin(scaledSlope) * clamp(intensity * 2.0, 0.0, 1.0);\n    gl_FragColor = accent_color * (1.0 - shade_color.a) + shade_color;\n\n#ifdef OVERDRAW_INSPECTOR\n    gl_FragColor = vec4(1.0);\n#endif\n}\n",vertexSource:"uniform mat4 u_matrix;\n\nattribute vec2 a_pos;\nattribute vec2 a_texture_pos;\n\nvarying vec2 v_pos;\n\nvoid main() {\n    gl_Position = u_matrix * vec4(a_pos, 0, 1);\n    v_pos = a_texture_pos / 8192.0;\n}\n"},line:{fragmentSource:"#pragma minemap: define highp vec4 color\n#pragma minemap: define lowp float blur\n#pragma minemap: define lowp float opacity\n\nuniform mediump float u_interpolate;\n\nvarying vec2 v_width2;\nvarying vec2 v_normal;\nvarying float v_gamma_scale;\nvarying float v_float;\nvarying vec3 v_color;\n\nvoid main() {\n    #pragma minemap: initialize highp vec4 color\n    #pragma minemap: initialize lowp float blur\n    #pragma minemap: initialize lowp float opacity\n\n    // Calculate the distance of the pixel from the line in pixels.\n    float dist = length(v_normal) * v_width2.s;\n\n    // Calculate the antialiasing fade factor. This is either when fading in\n    // the line in case of an offset line (v_width2.t) or when fading out\n    // (v_width2.s)\n    float blur2 = (blur + 1.0 / DEVICE_PIXEL_RATIO) * v_gamma_scale;\n    float alpha = clamp(min(dist - (v_width2.t - blur2), v_width2.s - dist) / blur2, 0.0, 1.0);\n\n    if(u_interpolate != 1.0){\n        gl_FragColor = color * (alpha * opacity);\n    }else{\n        gl_FragColor = vec4(v_color,1.0) * (alpha * opacity);\n    }\n\n#ifdef OVERDRAW_INSPECTOR\n    gl_FragColor = vec4(1.0);\n#endif\n}\n",vertexSource:"\n\n// the distance over which the line edge fades out.\n// Retina devices need a smaller distance to avoid aliasing.\n#define ANTIALIASING 1.0 / DEVICE_PIXEL_RATIO / 2.0\n\n// floor(127 / 2) == 63.0\n// the maximum allowed miter limit is 2.0 at the moment. the extrude normal is\n// stored in a byte (-128..127). we scale regular normals up to length 63, but\n// there are also \"special\" normals that have a bigger length (of up to 126 in\n// this case).\n// #define scale 63.0\n#define scale 0.015873016\n\nattribute vec4 a_pos_normal;\nattribute vec4 a_data;\nattribute vec2 a_ext;   // 0 a_h    1 interpolate 百分比\n\nuniform mat4 u_matrix;\nuniform mediump float u_ratio;\nuniform vec2 u_gl_units_to_pixels;\nuniform mediump float u_interpolate;\nuniform mediump float u_half_render;\n\nvarying vec2 v_normal;\nvarying vec2 v_width2;\nvarying float v_gamma_scale;\nvarying float v_float;\nvarying vec3 v_color;\n\n#pragma minemap: define highp vec4 color\n#pragma minemap: define lowp float blur\n#pragma minemap: define lowp float opacity\n#pragma minemap: define mediump float gapwidth\n#pragma minemap: define lowp float normaldirection\n#pragma minemap: define lowp float offset\n#pragma minemap: define mediump float width\n#pragma minemap: define lowp float instatus\n#pragma minemap: define lowp float status\n\nvec3 my_colors[3];\n\nvoid main() {\n    #pragma minemap: initialize highp vec4 color\n    #pragma minemap: initialize lowp float blur\n    #pragma minemap: initialize lowp float opacity\n    #pragma minemap: initialize mediump float gapwidth\n    #pragma minemap: initialize lowp float normaldirection\n    #pragma minemap: initialize lowp float offset\n    #pragma minemap: initialize mediump float width\n    #pragma minemap: initialize lowp float instatus\n    #pragma minemap: initialize lowp float status\n\n    my_colors[0] = vec3(52,151,162);\n    my_colors[1] = vec3(171,182,26);\n    my_colors[2] = vec3(175,95,29);\n\n    if(u_interpolate == 1.0){\n\n        vec3 inColor;\n        vec3 myColor;\n        if(instatus == 1.0){\n            inColor = my_colors[0];\n        }else if(instatus == 2.0){\n            inColor = my_colors[1];\n        }else if(instatus == 3.0){\n            inColor = my_colors[2];\n        }\n\n        if(status == 1.0){\n            myColor  = my_colors[0];\n        }else if(status == 2.0){\n            myColor = my_colors[1];\n        }else if(status == 3.0){\n            myColor = my_colors[2];\n        }\n\n        v_color = get_interp_color(inColor, myColor, a_ext[1]/1000.0);\n    }\n\n    vec2 a_extrude = a_data.xy - 128.0;\n    float a_direction = mod(a_data.z, 4.0) - 1.0;\n\n    vec2 pos = a_pos_normal.xy;\n\n    // x is 1 if it's a round cap, 0 otherwise\n    // y is 1 if the normal points up, and -1 if it points down\n    mediump vec2 normal = a_pos_normal.zw;\n    v_normal = normal;\n\n    // these transformations used to be applied in the JS and native code bases.\n    // moved them into the shader for clarity and simplicity.\n    gapwidth = gapwidth / 2.0;\n    float halfwidth = width / 2.0;\n    offset = -1.0 * offset;\n\n    float inset = gapwidth + (gapwidth > 0.0 ? ANTIALIASING : 0.0);\n    float outset = gapwidth + halfwidth * (gapwidth > 0.0 ? 2.0 : 1.0) + ANTIALIASING;\n    if(u_half_render == 1.){\n        if(normaldirection == 1.){\n            outset = gapwidth + (normal.y>0.?halfwidth:0.) * (gapwidth > 0.0 ? 2.0 : 1.0) + ANTIALIASING;\n        }else{\n            outset = gapwidth + (normal.y<0.?halfwidth:0.) * (gapwidth > 0.0 ? 2.0 : 1.0) + ANTIALIASING;\n        }\n\n    }\n\n    // Scale the extrusion vector down to a normal and then up by the line width\n    // of this vertex.\n    mediump vec2 dist = outset * a_extrude * scale;\n\n    // Calculate the offset when drawing a line that is to the side of the actual line.\n    // We do this by creating a vector that points towards the extrude, but rotate\n    // it when we're drawing round end points (a_direction = -1 or 1) since their\n    // extrude vector points in another direction.\n    mediump float u = 0.5 * a_direction;\n    mediump float t = 1.0 - abs(u);\n    mediump vec2 offset2 = offset * a_extrude * scale * normal.y * mat2(t, -u, u, t);\n\n    vec4 projected_extrude = u_matrix * vec4(dist / u_ratio, 0.0, 0.0);\n    gl_Position = u_matrix * vec4(pos + offset2 / u_ratio, 0.0, 1.0) + projected_extrude;\n\n    // calculate how much the perspective view squishes or stretches the extrude\n    float extrude_length_without_perspective = length(dist);\n    float extrude_length_with_perspective = length(projected_extrude.xy / gl_Position.w * u_gl_units_to_pixels);\n    v_gamma_scale = extrude_length_without_perspective / extrude_length_with_perspective;\n\n    v_width2 = vec2(outset, inset);\n}\n"},line3d:{fragmentSource:"#pragma minemap: define highp vec4 color\n#pragma minemap: define lowp float blur\n#pragma minemap: define lowp float opacity\n\nuniform vec4 u_color_a;\nuniform vec4 u_color_b;\nuniform vec4 u_color_c;\nuniform vec4 u_color_d;\nuniform vec4 u_color_e;\nuniform float u_max_height;\nuniform float u_is_contour;\nuniform mediump float u_interpolate;\n\nuniform float u_shine_height; //this is used to make the line splash\n\nvarying vec2 v_width2;\nvarying vec2 v_normal;\nvarying float v_gamma_scale;\nvarying float v_h;\nvarying vec3 v_color;\n\n#define Interval 70.0\nvoid main() {\n    #pragma minemap: initialize highp vec4 color\n    #pragma minemap: initialize lowp float blur\n    #pragma minemap: initialize lowp float opacity\n\n    if(u_is_contour == 1.0){\n\n        // Calculate the distance of the pixel from the line in pixels.\n            float dist = length(v_normal) * v_width2.s;\n\n        float m_opacity = 1.0;\n\n        float loop_count = mod(u_shine_height ,u_max_height);\n\n        if(v_h >= loop_count - Interval && v_h <= loop_count + Interval){\n            m_opacity = 1.0 + (1.0 - abs(v_h - loop_count)/Interval) * 3.0;\n        }\n\n        // Calculate the antialiasing fade factor. This is either when fading in\n        // the line in case of an offset line (v_width2.t) or when fading out\n        // (v_width2.s)\n        float blur2 = (blur + 1.0 / DEVICE_PIXEL_RATIO) * v_gamma_scale;\n        float alpha = clamp(min(dist - (v_width2.t - blur2), v_width2.s - dist) / blur2, 0.0, 1.0);\n\n\n        if (v_h < 0.25 * u_max_height) {\n\n            vec4 real = mix(u_color_a,u_color_b,v_h/0.25/u_max_height) * (alpha * opacity);\n            gl_FragColor = real * m_opacity;\n\n        } else if (v_h < 0.5 * u_max_height) {\n\n            vec4 real = mix(u_col